import React, { useEffect, useState } from "react";
import { Layout } from "./components";
import { Login } from "./pages";

function App() {
	const [isAuth, setisAuth] = useState(false);
	useEffect(() => {
		if (!isAuth) {
			return <Login />;
		}
	}, []);

	return (
		<div className="w-full min-h-[100vh%]">
			{isAuth ? "hello" : "hi"}
		</div>
	);
}

export default App;
